        const [showState,setShowState] = useState(false)
        let Authorization = `Bearer ${localStorage.getItem("jwt")}`


        return (
            <div className="search-form">
                <Modal active={showState} setActive={setShowState} children={<Search/>}/>
                   <button onClick={()=>setShowState(true)}>Show modal</button>

        </div>
        );
    };
    
export default Main;
